{
  "version": "0.2",
  "phases": {
    "pre_build": {
      "commands": [
        "yarn install && yarn global add aws-cdk@1.69.0"
      ]
    },
    "build": {
      "commands": [
        "yarn run cdksynth"
      ]
    }
  },
  "artifacts": {
    "base-directory": "cdk.out",
    "files": "**/*"
  }
}
